import React, { Component } from 'react';
import "../App.css"

const TodoSubList = props => {

    let container = props.steps.map(input =>
        <div>
            <li>{input.miniT}</li>
            <li>{input.completed}</li>
        </div>)

    return container
}



export default TodoSubList;
